import React, {useState} from 'react';
import axios from 'axios';
import { Link } from '@reach/router';

function PokemonAx() {
    const [pokemon, setPokemon] = useState([])

    function getPokemon() {
        axios.get("https://pokeapi.co/api/v2/pokemon/?limit=807")
        .then(response => setPokemon([...response.data.results]))
        .catch(err => console.log(err))
        axios.get("")
    }


    console.log("this is the pokemon ", pokemon);
    return (
        <div>
            <h1>Gotta catch em all (Axios API)</h1>
            <button onClick={getPokemon} >Axios Pokemon</button>
            <br/>
            <Link to="/route-fetch">Go to fetch pokemon api</Link>
            <ul>
                {pokemon.map((el, i) =>
                    <li key={i}>{el.name} <br/> {el.url}</li>
                )}

            </ul>

        </div>
    )
}

export default PokemonAx;
